INSERT INTO `coopmego_db_field_revision_body` VALUES ('node','noticia',0,5,5,'und',0,'Lorem ipsum dolor sit amet, consectetur adipisicing elit. Nemo maiores explicabo animi laboriosam culpa ex aliquam quas. Atque tenetur nisi sunt consequatur. Ratione ea aperiam, consequatur omnis id delectus rem.','','filtered_html'),('node','noticia',0,6,6,'und',0,'Lorem ipsum dolor sit amet, consectetur adipisicing elit. Nemo maiores explicabo animi laboriosam culpa ex aliquam quas. Atque tenetur nisi sunt consequatur. Ratione ea aperiam, consequatur omnis id delectus rem.','','filtered_html'),('node','noticia',0,7,7,'und',0,'Lorem ipsum dolor sit amet, consectetur adipisicing elit. Nemo maiores explicabo animi laboriosam culpa ex aliquam quas. Atque tenetur nisi sunt consequatur. Ratione ea aperiam, consequatur omnis id delectus rem.','','filtered_html'),('node','noticia',0,8,8,'und',0,'Lorem ipsum dolor sit amet, consectetur adipisicing elit. Nemo maiores explicabo animi laboriosam culpa ex aliquam quas. Atque tenetur nisi sunt consequatur. Ratione ea aperiam, consequatur omnis id delectus.','','filtered_html'),('node','page',0,12,12,'und',0,'La tarjeta Visa CoopMego ha sido específicamente concebida para superar sus más altas expectativas dándole a Usted un mayor poder de compra y la máxima flexibilidad para efectuar sus pagos. \r\n\r\n¿Por qué solicitar una tarjeta de crédito VISA Clásica de CoopMego?\r\n\r\n* Aceptada en más de 25 millones de establecimientos afiliados\r\n* Acceso a 750.000 cajeros automáticos en la RED PLUS\r\n* Realiza avances de efectivo cuando y donde tú lo necesites\r\n* Difiere tus consumos nacionales e internacionales en produbanco.com\r\n* Personaliza tu cupo para compras en el país, exterior e internet a través de produbanco.com \r\n* Regístrate en www.produbox.com, realiza tus compras en Estados Unidos y recíbelas en Ecuador\r\n* Escoge la fecha de corte de tu estado de cuenta, puede ser el 15 ó el 30 de cada mes\r\n* Realiza el pago total o mínimo (crédito rotativo)\r\n\r\nConsulta sobre seguro de viajes, reposición urgente de tarjeta y servicio de efectivo de emergencia en el Centro de Asistencia VISA, www.lac.visa.com  ','','filtered_html'),('node','page',0,13,13,'und',0,'Tarjeta Mastercard CoopMego te permitirá comprar en más de 28 millones de comercios afiliados a MasterCard en Ecuador y el mundo, la compra se debitará del saldo disponible de la cuenta corriente/ahorros pagando solamente lo que consume, sin recargos adicionales.\r\n\r\nAdemás con tu tarjeta PacifiCard puedes realizar en los cajeros de la CoopMego las siguientes transacciones:\r\n\r\n* Pago de tarjetas (MasterCard y Visa).\r\n* Compra de Pines y tiempo Aire para Celular (Claro, Movistar y CNT).\r\n* Pago de servicios básicos (Agua, luz y teléfono).\r\n* Pago de impuestos prediales.\r\n* Pago de matriculación vehicular y transferencia de dominio.\r\n* Pago de centros educativos y televisión pagada.\r\n* Retiros de Efectivo.\r\n* Consulta de saldos de cuenta corriente o de ahorros.\r\n* Transferencias entre cuentas del Banco ','','filtered_html'),('node','page',0,14,14,'und',0,'La Superintendencia de Compañías es el organismo técnico, con autonomía administrativa y económica, que vigila y controla la organización, actividades, funcionamiento, disolución y liquidación de las compañías y otras entidades en las circunstancias y condiciones establecidas por la Ley.\r\n\r\nLa Superitendencia de Compañías controla, vigila y promueve el mercado de valores, el sector societario y de seguros, mediante sistemas de regulación y servicios, contribuyendo al desarrollo confiable y transparente de la actividad empresarial en el país.','','filtered_html');
/*!40000 ALTER TABLE `coopmego_db_field_revision_body` ENABLE KEYS */;
UNLOCK TABLES;

